const Problem = () => {
    return (
        <section className="flex flex-row items-center w-full justify-center mq450:h-auto">
        <div id="container" className="flex flex-col max-w-[1280px] w-full justify-between px-[24px] gap-[64px] mq450:px-4 h-full py-[80px]">
        <div id="top" className="flex flex-row gap-[64px] justify-center items-center">
            <div id="left" className="flex flex-col w-full gap-[16px]">
                <div id="title" className='font-satoshi-bold font-[600] text-[18px] leading-[130%] text-[#4040F2]'>PROBLEM</div>
                <div id="subtitle" className='font-satoshi-bold font-[600] text-[40px] leading-[130%] text-[#4040F2]'>Twoje konto w banku to nie Twoja twierdza</div>
            </div>
            <div id="right" className="w-full">
            <div id='text' className='font-satoshi-medium text-right font-[400] text-[20px] leading-[150%] text-[#4040F2]'>Bank, skarbówka – wszyscy mają do niego klucze. A Ty?</div>
            </div>
        </div>
        <div id="table" className="flex w-full">
            <div id="column" className="flex flex-col w-full">
                <div id="line" className="flex font-satoshi-bold font-[600] text-[16px] leading-[130%] text-[#4040F2] uppercase h-[80px] px-[16px] items-center" style={{ borderBottom: '1px solid #BF6EA3' }}>Aspekt</div>
            </div>
        </div>
        </div>
      </section>
    );
  };

  export default Problem;
